import React from "react";
import contact from "./contact";
import Detail from "./Detail";

function Card(props) {
    return (
        <div>
            <h1>{props.name}</h1>
            <Detail Detailinfo = {props.tel} />
            <Detail Detailinfo = {props.email} />

        </div>
    );
}
export default Card;
